const randomIndex = Math.floor(Math.random() * 16);
function generateLandLowerLevel() {
    let html = '';
    let randomIndex = Math.floor(Math.random() * 16);
    let randomCount = Math.floor(Math.random() * 4) + 1; // Случайное количество <td> элементов между <Tree_1> и <Tree_2>

    for (let i = 0; i < 16; i++) {
        if (i === randomIndex) {
            html += '<Hero></Hero>';
            for (let j = 0; j < randomCount; j++) {
                html += '<td></td>';
            }
            html += '<Tree_1></Tree_1>';
            let randomTreeCount = Math.floor(Math.random() * 4) + 1; // Случайное количество <Tree_1> элементов
            for (let k = 0; k < randomTreeCount; k++) {
                html += '<Tree_1></Tree_1>';
            }
            html += '<td></td>';
            html += '<Tree_2></Tree_2>';
        } else {
            html += '<td></td>';
        }
    }

    return (
        <React.StrictMode>
            {html}
        </React.StrictMode>
    );
}

Land_lower_level.render(
    generateLandLowerLevel(),
    document.getElementById('root')
);
Bird_lower_level.render(
    <React.StrictMode>
            {[...Array(16)].map((_,i) =>
                i === randomIndex ? <Bird /> : <td></td>
            )}
    </React.StrictMode>,
